import { useEffect, useState } from 'react';

export default function AgeChecker({ number }) {
    const [decision, setDecision] = useState()


    useEffect(() => {
        console.log("Render, number is " + number)
        let result = "No way"
        if(number < 18) result = "Under 18"
        if(number < 21) result = "Under 21"
        if(number > 21) result = "Ok ti drink"
        setDecision(result)
    }, [number])

    return(
        <>
        {decision}
        </>
    )
}
